import React from 'react'

function SearchExercise(){
  const [searchExercise, setSearchExercise] = React.useState()
  return(
    <input onChange={(query)=>{
      return searchExercise.filter(item =>{
        return item.text.incluides(query)
      })
      //console.log('Cambiamos')
      // console.log(event.target.value)
    }} 
    placeholder="Buscar ejercicio"
    />
  )
}
export {SearchExercise}

const styleList = {
  background: 'green',
    width: '160px',
    textAlign: 'center',
    height: '40px',
    display: 'flex',
    alignItems: 'center',
    borderRadius: '20px',
    color: 'white',
    margin: '20px',
}

const styleInput ={
  display: 'flex',
  justifyContent: 'center'
}

function TodoItem(props){ // Creando un complemento que por dentro lleva los elementos que se mostraran en el navegador y se podran reutilizar si es necesario
    return(
      <div style={styleList}>
        <input
        style={styleInput} 
        id="input-exercise" 
        type="checkbox" 
        name="exercise"></input>

        <label 
        htmlFor='input-exercise'
        >{props.text}</label>
      </div>
    )
}
export {TodoItem} // Todos los componenetes se deben exportar al finalizarlo y una buena practica para no exportarlo por default lo hacemos con la sintaxis de un objeto
